import React from 'react'
import './Header.css'
import miyagilogo from '../assests/logosmall.png'

const header = () => {
    return (
        <div className = "header">
            <div className="header__logo">
                <img src={miyagilogo} alt="miyagi logo" />
            </div>
        </div>
    )
}

export default header
